import React from 'react';
import { Link, useNavigate, useLocation } from 'react-router-dom';
import './Navbar.css';

const Navbar = ({ user, onLogout }) => {
  const navigate = useNavigate();
  const location = useLocation();
  const [message, setMessage] = React.useState('');
  const [showMessage, setShowMessage] = React.useState(false);
  const isAuthenticated = !!user;

  const handleLogout = () => {
    onLogout();
    navigate('/login');
  };

  const handleProtectedClick = (e) => {
    if (!isAuthenticated) {
      e.preventDefault();
      setMessage('Please login first to access this feature.');
      setShowMessage(true);
      setTimeout(() => setShowMessage(false), 3000);
    }
  };

  return (
    <nav className="navbar">
      {showMessage && (
        <div className="custom-message-box">{message}</div>
      )}
      <div className="navbar-inner">
        <div className="navbar-logo-box">
          <Link to="/">
            <img src="/S.png" alt="SuperMotor Logo" className="navbar-logo navbar-logo-pointer" />
          </Link>
        </div>
        <div className="navbar-links">
          {isAuthenticated ? (
            <>
              <Link className="navbar-link" to="/">Home</Link>
              <Link className="navbar-link" to="/cars">Buy</Link>
              <Link className="navbar-link" to="/sell">Sell</Link>
              <Link className="navbar-link" to="/bookings">My Bookings</Link>
              <Link className="navbar-link" to="/wishlist">Shortlisted</Link>
              <Link className="navbar-link" to="/orders">My Orders</Link>
              <Link className="navbar-link" to="/account">Account</Link>
              <button className="navbar-logout" onClick={handleLogout}>Logout</button>
            </>
          ) : (
            <>
              <Link className="navbar-link" to="/">Home</Link>
              <Link className="navbar-link" to="/cars" onClick={handleProtectedClick}>Buy</Link>
              <Link className="navbar-link" to="/sell" onClick={handleProtectedClick}>Sell</Link>
              <Link className="navbar-link" to="/login">Login</Link>
            </>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
